import LoginComponent from "./login";
import React, { Component } from "react";
import './login.css'

class Todo extends Component{
    constructor(props){
        super(props);
        this.generateTodos = this.generateTodos.bind(this);
    }

    render(){
        return(
            <div className="todo">
                <LoginComponent style={{margin: '45px'}}/>
                <ul className="list-group">
                    {this.generateTodos()}
                </ul>
            </div>
        );
    }

    generateTodos(){
        let todos =
        [
            {id: 0, task: 'Eat'},
            {id: 1, task: 'Sleep'},
            {id: 2, task: 'Code'},
            {id: 3, task: 'Repeat'}
        ];

        let ret = todos.map( todo => <li key={todo.id} className="list-group-item"> {todo.task} </li>);
        console.log(ret);
        return ret;
    }
}

export default Todo;
